       SUBROUTINE SWAPEL(N,A)
C------------------------------------------------------------------
C      swaps elements of array
C------------------------------------------------------------------
       INTEGER N,I  
       REAL A(N),AT(N)
       DO 10 I=1,N
10      AT(I)=A(I) 
       DO 20 I=0,N-1
20      A(I+1)=AT(N-I)                   
       RETURN
       END
