      SUBROUTINE TIF107(PF107,INVDP,C,SEZA,SEZB,
     &                  ASOL,BSOL,ASOL2,BSOL2,CSOL2,  
     &                  TP350A,TP350B,TP430A,TP430B,
     &                  TP600A,TP600B,TP850A,TP850B)
