     &            TP850A,TP850B
C     linear perturbation AL, BL
      AL350A=0.0
      AL350B=0.0
      AL430A=0.0
      AL430B=0.0
      AL600A=0.0
      AL600B=0.0
      AL850A=0.0
      AL850B=0.0
